import CategoryField from '../Components/CategoryField/CategoryField';
import Cards from '../Cards/Cards';
import addIcon from '../resources/add.svg';

import './Body.css';

function Body(props){
    let categoryFields = props.categories.map((val)=>{
        return(
            <CategoryField categoryName = {val} key= {val}>{<Cards/>}</CategoryField>
        );
    });
    return(
        <div className= 'div-body'>
            {categoryFields}
            <div className= 'div-add-button'>
                <a href= 'http://localhost:3000' className= 'add-link'>
                    <img className= 'add-icon' src= {addIcon} alt= 'add'/>
                </a>
            </div>
        </div>
    );
    
}

export default Body;
